import FooterIcons from '../data/FooterIcons';

const Footer = () => {
    return (
        <div className="footer-content">
            <h1 className='footer-content-title'>Get in touch with me on other platforms</h1>
            <FooterIcons />
        </div>
        
    )    

}

export default Footer;
